#include <Wire.h>

node {
    meta {
        struct Device {
            TwoWire* i2c;
            uint8_t addr;
        };
        using Type = Device*;
    }

    Device dev;
    void evaluate(Context ctx) {
        dev.i2c = getValue<input_I2C>(ctx);
        dev.addr = getValue<input_ADDR>(ctx);
        emitValue<output_DEV>(ctx, &dev);
    }
}

node {
    meta {
        struct Device {
            Number reg4 = 0;
            Number mult = 1;
        };

        using Type = Device*;
    }

    Device dev;

    void evaluate(Context ctx) {
        dev.reg4 = getValue<input_REG4>(ctx);
        dev.mult = getValue<input_MULT>(ctx);

        emitValue<output_OUT>(ctx, &dev);
    }
}

